import logo from '../../imagens/logo.svg';
import styled from 'styled-components';

const LogoComponente = styled.div`
  display: flex;
  font-size: 30px;
`

const LogoImagComponente = styled.img`
  margin-right: 10px;
`

function Logo() {
    return (
        <LogoComponente>
          <LogoImagComponente 
            src={logo} 
            alt='logo-alura-books' 
            className='logo-img'
          ></LogoImagComponente>
          <p><strong>Alura</strong>Books</p>
        </LogoComponente>
    )
}

export default Logo;
